import React from "react";
import { useNavigate } from "react-router-dom";

function disp({ authorised }) {
  let Navigate = useNavigate;
  if (!authorised) {
    return <Navigate to="/login" />;
  }
  return;
  <div>Your in profile page</div>;
}

export default disp;
